column7:
Either of the following: In a CREATE TABLE or ALTER TABLE statement, NOT was entered to specify that no null values are allowed in that column, but the keyword NULL was omitted. In the IS [NOT] NULL logical operator, the keyword NULL was not found. For example, the following statement generates this message: 

SELECT * FROM EMP WHERE DEPTNO IS NOT; 


The keyword NULL must follow the keywords IS NOT.

column8:
From Oracle doc: To add data to a cluster from an existing table, use the following series of SQL statements:

CREATE TABLE newtable SELECT * FROM oldtable CLUSTER clustername;
DROP oldtable;
RENAME TABLE newtable oldtable;

column7:
Host string contains reference to object (which does not exist):

@d:node-obj => object is ORDNobj; 


when node is VMS, the object is ORDNobj.COM 

when node is UNIX, the object is ORDNobj @d:node::"task=obj" => object is obj; 

when node is VMS, the object is obj.COM 

when node is UNIX, the object is obj
